class Solution:
    def shortestMatchingSubstring(self, s: str, p: str) -> int:
        def match(s, p, i, j):
            if i == len(s) or j == len(p):
                return i == len(s) and j == len(p)
            if p[j] == '*':
                if j == len(p) - 1:
                    return i == len(s)
                if match(s, p, i, j + 2):
                    return True
                while i < len(s) and s[i] == p[j + 1]:
                    i += 1
                return match(s, p, i, j + 2)
            return s[i] == p[j] and match(s, p, i + 1, j + 1)

        n, m = len(s), len(p)
        if m == 2:
            if p[0] == '*':
                return n
            if p[1] == '*':
                return n - 1
            return -1

        dp = [[0] * (m + 1) for _ in range(n + 1)]
        dp[0][0] = 1
        for i in range(1, n + 1):
            if s[i - 1] == p[0]:
                dp[i][1] = dp[i - 1][1] or dp[i - 1][0]
            for j in range(2, m + 1):
                if p[j - 1] == '*':
                    if j == 2:
                        dp[i][j] = dp[i - 1][j] or dp[i - 1][j - 1]
                    else:
                        dp[i][j] = dp[i][j - 1] or dp[i - 1][j] or dp[i - 1][j - 2]
                else:
                    if s[i - 1] == p[j - 1]:
                        dp[i][j] = dp[i - 1][j - 1]
                    else:
                        dp[i][j] = 0
        return dp[n][m] if dp[n][m] else -1
