        if len(p) == 0:
            return 0

        # Find the positions of the two '*' characters in p
        star1 = p.find('*')
        star2 = p.find('*', star1 + 1)

        # If there are no '*' characters, return the length of s
        if star1 == -1:
            return len(s)

        # Initialize the pointers for s and p
        i, j = 0, 0

        # Initialize the length of the shortest matching substring
        min_len = float('inf')

        # Iterate through s
        while i < len(s):
            # If the current character in s matches the current character in p, move both pointers
            if s[i] == p[j]:
                i += 1
                j += 1
            # If the current character in p is '*', move the pointer in p
            elif p[j] == '*':
                j += 1
            # If the current character in s does not match the current character in p, move the pointer in s
            else:
                i += 1
                # If the current character in p is the first '*', move the pointer in p to the second '*'
                if j == star1:
                    j = star2 + 1
                # If the current character in p is the second '*', move the pointer in p to the first '*'
                elif j == star2:
                    j = star1 + 1
                # If the current character in p is neither '*', move the pointer in p to the first '*'
                else:
                    j = star1 + 1
                    i += 1

        # If the length of the shortest matching substring is still infinity, return -1
        if min_len == float('inf'):
            return -1

        # Return the length of the shortest matching substring
