class Solution:
    def shortestMatchingSubstring(self, s: str, p: str) -> int:
        if not p:
            return 0

        # Find the indices of the '*' characters in p
        star1, star2 = p.find('*'), p.rfind('*')

        # If there are no '*' characters, return the length of s
        if star1 == -1 and star2 == -1:
            return len(s)

        # If there is only one '*', find the longest prefix of s that matches the prefix of p
        if star1 == -1:
            return len(s) - p.rfind(s[:star2])

        # If there is only one '*', find the longest suffix of s that matches the suffix of p
        if star2 == -1:
            return len(s) - p.find(s[star1:])

        # Find the longest prefix of s that matches the prefix of p and the longest suffix of s that matches the suffix of p
        prefix = p[:star1]
        suffix = p[star2+1:]
        prefix_len = len(prefix)
        suffix_len = len(suffix)

        # Find the longest common prefix and suffix of s
        common_prefix = ''
        common_suffix = ''
        for i in range(min(prefix_len, suffix_len)):
            if prefix[i] == suffix[i]:
                common_prefix += prefix[i]
            else:
                break

        # Calculate the length of the shortest matching substring
        return len(s) - len(common_prefix) - len(common_suffix)
