class Solution:
    def minCostGoodCaption(self, caption: str) -> str:
        n = len(caption)
        if n < 3:
            return ""

        # Create a list to store the minimum cost to make each character good
        dp = [0] * 26

        # Iterate through the caption from the end to the beginning
        for i in range(n - 2, -1, -1):
            # Check if the current character can be made good by changing it to the next or previous character
            if caption[i] == 'a':
                dp[caption[i] - 'a'] = min(dp[caption[i] - 'a'], dp[caption[i + 1] - 'a'] + 1)
            elif caption[i] == 'z':
                dp[caption[i] - 'a'] = min(dp[caption[i] - 'a'], dp[caption[i - 1] - 'a'] + 1)
            else:
                dp[caption[i] - 'a'] = min(dp[caption[i] - 'a'], dp[caption[i - 1] - 'a'] + 1, dp[caption[i + 1] - 'a'] + 1)

        # If the minimum cost is greater than n, it is impossible to make the caption good
        if dp[0] > n:
            return ""

        # Create a list to store the final caption
        final_caption = ['a'] * n

        # Iterate through the caption from the end to the beginning
        for i in range(n - 2, -1, -1):
            # Check if the current character can be made good by changing it to the next or previous character
            if caption[i] == 'a':
                final_caption[i] = chr(ord('a') + dp[caption[i] - 'a'])
            elif caption[i] == 'z':
                final_caption[i] = chr(ord('z') - dp[caption[i] - 'a'])
            else:
                final_caption[i] = chr(ord('a') + dp[caption[i] - 'a'])

        # Return the final caption
        return ''.join(final_caption)
