    def minOperations(self, nums: List[int], x: int, k: int) -> int:
        n = len(nums)
        prefix_sum = [0] * (n + 1)
        for i in range(1, n + 1):
            prefix_sum[i] = prefix_sum[i - 1] + nums[i - 1]

        # Dictionary to store the difference between prefix sums and their indices
        diff_index = {}
        diff_index[0] = -1

        min_operations = float('inf')

        for i in range(n):
