class Solution:
    def minMaxWeight(self, n: int, edges: List[List[int]], threshold: int) -> int:
        # Build the graph
        graph = [[] for _ in range(n)]
        for a, b, w in edges:
            graph[a].append((b, w))
            graph[b].append((a, w))

        # Perform DFS to find the connected components
        visited = [False] * n
        components = []
        for i in range(n):
            if not visited[i]:
                component = []
                self.dfs(graph, i, visited, component)
                components.append(component)

        # Calculate the minimum edge weight for each component
        min_weights = []
        for component in components:
            if len(component) < threshold:
                continue
            weights = [edge[1] for edge in component]
            weights.sort()
            min_weights.append(weights[0])

        # Find the minimum of the minimum edge weights
        return min(min_weights) if min_weights else -1

    def dfs(self, graph, node, visited, component):
        visited[node] = True
        component.append(node)
        for neighbor, weight in graph[node]:
            if not visited[neighbor]:
                self.dfs(graph, neighbor, visited, component)
