    def minMaxWeight(self, n: int, edges: List[List[int]], threshold: int) -> int:
        # Build the adjacency list representation of the graph
        adj = [[] for _ in range(n)]
        for u, v, w in edges:
            adj[u].append((v, w))
            adj[v].append((u, w))

        # Function to perform DFS to find the maximum weight of a path from node 0
        def dfs(node, parent, visited, max_weight):
            visited[node] = True
            max_weight = max(max_weight, w)
            for neighbor, w in adj[node]:
                if neighbor != parent and not visited[neighbor]:
                    max_weight = dfs(neighbor, node, visited, max_weight)
            return max_weight

        # Function to find the minimum maximum weight of a path from node 0
        def min_max_weight(node, parent, visited, max_weight):
            visited[node] = True
            max_weight = max(max_weight, w)
            for neighbor, w in adj[node]:
                if neighbor != parent and not visited[neighbor]:
                    max_weight = min(max_weight, min_max_weight(neighbor, node, visited, max_weight))
            return max_weight

        # Initialize the visited array and the maximum weight
        visited = [False] * n
        max_weight = 0

        # Perform DFS to find the maximum weight of a path from node 0
        for i in range(n):
            if not visited[i]:
                max_weight = max(max_weight, dfs(i, -1, visited, 0))

        # Check if it is possible to remove some edges to satisfy the conditions
        for i in range(n):
            if not visited[i]:
                visited[i] = True
                max_weight = min(max_weight, min_max_weight(i, -1, visited, 0))

        # Return the minimum possible value of the maximum edge weight
        return max_weight if max_weight != float('inf') else -1
