class Solution:
    def maxSum(self, nums: List[int], k: int, m: int) -> int:
        n = len(nums)
        if n < k * m:
            return -1

        # Initialize the prefix sums array
        prefix_sum = [0] * (n + 1)
        for i in range(1, n + 1):
            prefix_sum[i] = prefix_sum[i - 1] + nums[i - 1]

        # Initialize the dp array to store the maximum sum of k non-overlapping subarrays
        dp = [0] * (n + 1)
        for i in range(k, n + 1):
            dp[i] = max(dp[i - 1], prefix_sum[i] - prefix_sum[i - k])

        # Initialize the result variable to store the maximum sum of k non-overlapping subarrays
        result = 0
        for i in range(k, n + 1):
            result = max(result, dp[i] + prefix_sum[i] - prefix_sum[i - k])

        return result
