class Solution:
    def distanceSum(self, m: int, n: int, k: int) -> int:
        MOD = 10**9 + 7

        # Calculate the number of ways to place k pieces on an m x n grid
        def count_ways(m, n, k):
            if k == 0:
                return 1
            if k == 1:
                return m * n
            if k == 2:
                return m * n * (m + n - 2)
            return (m * n * (m + n - 2) * (m + n - 3)) // 6

        # Calculate the sum of Manhattan distances between all pairs of pieces
        def sum_distances(m, n, k):
            if k == 0:
                return 0
            if k == 1:
                return m * n
            if k == 2:
                return m * n * (m + n - 2)
            return (m * n * (m + n - 2) * (m + n - 3)) // 6

        # Calculate the number of ways to place k pieces on an m x n grid
        ways = count_ways(m, n, k)

        # Calculate the sum of Manhattan distances between all pairs of pieces
        distances = sum_distances(m, n, k)

        # Return the result modulo 10^9 + 7
        return distances % MOD
