class Solution:
    def distanceSum(self, m: int, n: int, k: int) -> int:
        MOD = 10**9 + 7
        dp = [[0] * (k + 1) for _ in range(m * n + 1)]
        for i in range(1, m * n + 1):
            dp[i][1] = i
        for i in range(2, k + 1):
            for j in range(1, m * n + 1):
                for x in range(1, m + 1):
                    for y in range(1, n + 1):
                        if i - x > 0 and j - y > 0:
                            dp[j][i] = (dp[j][i] + dp[j - x][i - y]) % MOD
                        elif i - x > 0:
                            dp[j][i] = (dp[j][i] + dp[j - x][i]) % MOD
                        elif j - y > 0:
                            dp[j][i] = (dp[j][i] + dp[j][i - y]) % MOD
                        else:
                            dp[j][i] = (dp[j][i] + dp[j][i]) % MOD
        return sum(dp[i][k] for i in range(1, m * n + 1)) % MOD
