    def maxFreeTime(self, eventTime: int, k: int, startTime: List[int], endTime: List[int]) -> int:
        # Sort the meetings by start time
        meetings = sorted(zip(startTime, endTime))

        # Initialize variables
        free_time = 0
        current_time = 0

        # Iterate through the sorted meetings
        for start, end in meetings:
            # If the current meeting starts after the current free time, update the free time
            if start > current_time:
                free_time = max(free_time, start - current_time)
            # Update the current time to the end of the current meeting
            current_time = max(current_time, end)

        # If there are still free time slots left after rescheduling, return the remaining free time
        return max(free_time, eventTime - current_time)

