    def sortMatrix(self, grid: List[List[int]]) -> List[List[int]]:
        n = len(grid)
        # Create a list of lists to store the elements of each diagonal
        diagonals = [[] for _ in range(2 * n - 1)]

        # Populate the diagonals
        for i in range(n):
            for j in range(n):
                diagonals[i + j].append(grid[i][j])

        # Sort each diagonal
        for i in range(2 * n - 1):
            diagonals[i].sort(reverse=True if i % 2 == 0 else True)

        # Fill the grid with the sorted diagonals
        for i in range(n):
            for j in range(n):
                grid[i][j] = diagonals[i + j].pop()

        return grid
