class Solution:
    def solveQueries(self, nums: List[int], queries: List[int]) -> List[int]:
        n = len(nums)
        ans = [-1] * len(queries)
        index_map = {}

        # Build the index map
        for i in range(n):
            if nums[i] not in index_map:
                index_map[nums[i]] = []
            index_map[nums[i]].append(i)

        # Process each query
        for i, q in enumerate(queries):
            if q in index_map:
                indices = index_map[q]
                if len(indices) == 1:
                    ans[i] = -1
                else:
                    # Find the closest index
                    closest_index = min(indices, key=lambda x: abs(x - q))
                    ans[i] = abs(closest_index - q)

        return ans
