    def solveQueries(self, nums: List[int], queries: List[int]) -> List[int]:
        n = len(nums)
        ans = [-1] * len(queries)
        left = [0] * n
        right = [0] * n
        for i in range(n):
            if i == 0:
                left[i] = 0
            else:
                left[i] = left[i-1] + (nums[i] == nums[i-1])
        for i in range(n-1, -1, -1):
            if i == n-1:
                right[i] = 0
            else:
                right[i] = right[i+1] + (nums[i] == nums[i+1])
        for i in range(len(queries)):
            if nums[queries[i]] == nums[0]:
                ans[i] = left[queries[i]]
            elif nums[queries[i]] == nums[-1]:
                ans[i] = right[queries[i]]
            else:
                left_index = bisect.bisect_left(left, queries[i])
                right_index = bisect.bisect_right(right, queries[i])
                if left_index < right_index:
                    ans[i] = min(left_index, right_index) - left_index
                else:
                    ans[i] = min(left_index, n - left_index) + right_index - n
        return ans

