class Solution:
    def maxFrequency(self, nums: List[int], k: int) -> int:
        n = len(nums)
        count = Counter(nums)
        max_freq = 0

        for i in range(n):
            for j in range(i, n):
                subarray_sum = sum(nums[i:j+1])
                if subarray_sum == k:
                    max_freq = max(max_freq, count[j-i+1])

        return max_freq
