    def findMaxSum(self, nums1: List[int], nums2: List[int], k: int) -> List[int]:
        n = len(nums1)
        res = [0] * n

        # Sort nums1 in descending order
        nums1.sort(reverse=True)

        # Use a min-heap to keep track of the k largest values in nums2
        heap = []

        for i in range(n):
            # Add the k largest values in nums2 to the heap
            for j in range(i, n):
                if len(heap) < k:
                    heapq.heappush(heap, nums2[j])
                elif nums2[j] > heap[0]:
                    heapq.heappop(heap)
                    heapq.heappush(heap, nums2[j])

            # Calculate the sum of the k largest values in nums2
            res[i] = sum(heap)

        return res

