class Solution:
    def maxSubstringLength(self, s: str, k: int) -> bool:
        n = len(s)
        if k == 0:
            return True

        # Create a set of all unique characters in the string
        unique_chars = set(s)

        # If the number of unique characters is less than k, it's impossible to select k disjoint special substrings
        if len(unique_chars) < k:
            return False

        # Create a dictionary to store the frequency of each character in the string
        char_freq = {}
        for char in s:
            if char in char_freq:
                char_freq[char] += 1
            else:
                char_freq[char] = 1

        # Create a list of tuples containing the character and its frequency
        char_freq_list = [(char, freq) for char, freq in char_freq.items()]

        # Sort the list of tuples by frequency in descending order
        char_freq_list.sort(key=lambda x: x[1], reverse=True)

        # Create a list to store the maximum length of each special substring
        max_lengths = []

        # Iterate over the sorted list of tuples
        for char, freq in char_freq_list:
            # If the frequency of the current character is greater than or equal to k, it can be used to create a special substring
            if freq >= k:
                # Add the length of the current special substring to the list
                max_lengths.append(freq)
                # Decrease the frequency of the current character by k
                char_freq[char] -= k
                # If the frequency of the current character becomes zero, remove it from the dictionary
                if char_freq[char] == 0:
                    del char_freq[char]

        # If the length of the list of maximum lengths is equal to k, it's possible to select k disjoint special substrings
        return len(max_lengths) == k

