class Solution:
    def maxProduct(self, nums: List[int], k: int, limit: int) -> int:
        nums.sort()
        n = len(nums)
        if n == 0:
            return -1

        # Initialize the result to -1
        result = -1

        # Iterate through all possible subsequence lengths
        for length in range(1, n + 1):
            # Iterate through all possible starting indices for the subsequence
            for start in range(n - length + 1):
                # Calculate the alternating sum of the subsequence
                alternating_sum = sum(nums[start:start + length:2]) - sum(nums[start:start + length:1])

                # Check if the alternating sum is equal to k
                if alternating_sum == k:
                    # Calculate the product of the subsequence
                    product = 1
                    for num in nums[start:start + length]:
                        product *= num
                        # Check if the product exceeds the limit
                        if product > limit:
                            break
                    # Update the result if the product is greater than the current result
                    if product > result:
                        result = product

        return result
