class Solution:
    def longestPalindrome(self, s: str, t: str) -> int:
        # Combine the two strings
        combined = s + t

        # Use the longest palindromic subsequence algorithm
        dp = [[0] * (len(combined) + 1) for _ in range(len(combined) + 1)]

        for i in range(1, len(combined) + 1):
            for j in range(1, len(combined) + 1):
                if combined[i-1] == combined[j-1]:
                    dp[i][j] = dp[i-1][j-1] + 1
                else:
                    dp[i][j] = max(dp[i-1][j], dp[i][j-1])

        # The length of the longest palindromic subsequence is the answer
        return dp[-1][-1]
