class Solution:
    def numberOfComponents(self, properties: List[List[int]], k: int) -> int:
        def intersect(a, b):
            return len(set(a) & set(b)) >= k

        graph = [[] for _ in range(len(properties))]
        for i in range(len(properties)):
            for j in range(i + 1, len(properties)):
                if intersect(properties[i], properties[j]):
                    graph[i].append(j)
                    graph[j].append(i)

        visited = set()
        def dfs(node):
            if node in visited:
                return
            visited.add(node)
            for neighbor in graph[node]:
                dfs(neighbor)

        components = 0
        for i in range(len(properties)):
            if i not in visited:
                dfs(i)
                components += 1

        return components
