def solve(N, M, A):
    MOD = 998244353
    dp = [[0] * (M + 1) for _ in range(N + 1)]
    dp[0][0] = 1

    for i in range(1, N + 1):
        for j in range(1, M + 1):
            if A[i - 1] == j:
                dp[i][j] = (dp[i - 1][j] + dp[i - 1][j - 1]) % MOD
            else:
                dp[i][j] = dp[i - 1][j]

    return dp[N][M]

