def count_even_odd_distance_graphs(N, P):
    def is_even(n):
        return n % 2 == 0

    def count_paths(n, k):
        if k == 0:
            return 1
        if k > n:
            return 0
        return n * count_paths(n - 1, k - 1) + count_paths(n - 1, k)

    def count_even_odd_distance(n, k):
        if k == 0:
            return 1
        if k > n:
            return 0
        return count_paths(n - 1, k - 1) + count_paths(n - 1, k)

    def count_even_odd_distance_modulo(n, k, P):
        if k == 0:
            return 1
