def longest_increasing_subsequence(A, X):
    n = len(A)
    dp = [1] * n
    for i in range(1, n):
        for j in range(i):
            if A[i] > A[j] and X[i] >= A[j] and dp[i] < dp[j] + 1:
                dp[i] = dp[j] + 1
    return max(dp)

