def min_stairs_moves(H, W, F, Q, queries):
    # Create a graph to represent the buildings and their connections
    graph = [[] for _ in range(H * W)]
    for i in range(H):
        for j in range(W):
            for dx, dy in [(0, 1), (0, -1), (1, 0), (-1, 0)]:
                nx, ny = i + dx, j + dy
                if 0 <= nx < H and 0 <= ny < W:
                    graph[i * W + j].append(nx * W + ny)
                    graph[nx * W + ny].append(i * W + j)

    # Initialize the distance array
    dist = [[float('inf')] * W for _ in range(H)]
    dist[0][0] = 0

    # Perform Dijkstra's algorithm
    pq = [(0, 0, 0)]
    while pq:
        d, x, y = heapq.heappop(pq)
        if d > dist[x][y]:
            continue
        for nx, ny in graph[x * W + y]:
            if d + 1 < dist[nx][ny]:
                dist[nx][ny] = d + 1
                heapq.heappush(pq, (d + 1, nx, ny))

    # Process each query
    results = []
    for A, B, Y, C, D, Z in queries:
        if A == C and B == D:
            results.append(0)
            continue
        path = []
        x, y = A * W + B
        while x != C * W + D:
            path.append((x, y))
            if x < C * W + D:
                x += 1
            else:
                x -= 1
        path.append((C * W + D, D))
        path.reverse()
        steps = 0
        for i in range(len(path) - 1):
            dx, dy = path[i + 1][0] - path[i][0], path[i + 1][1] - path[i][1]
            if dx == 0:
                steps += F[path[i][0]] - Y
            elif dy == 0:
                steps += F[path[i][1]] - Y
            else:
                steps += min(F[path[i][0]], F[path[i][1]]) - Y
        results.append(steps)

    return results

