import sys
from collections import defaultdict

def read_input():
    n, k = map(int, sys.stdin.readline().split())
    edges = defaultdict(list)
    for _ in range(n - 1):
        u, v = map(int, sys.stdin.readline().split())
        edges[u].append(v)
        edges[v].append(u)

    return n, k, edges

def is_decomposable(n, k, edges):
    # Check if the graph is connected
    visited = [False] * (n + 1)
    def dfs(node):
        visited[node] = True
        for neighbor in edges[node]:
            if not visited[neighbor]:
                dfs(neighbor)
    dfs(1)
    if not all(visited):
        return False

    # Check if the graph is a tree
    parent = [0] * (n + 1)
    def dfs2(node, parent_node):
        parent[node] = parent_node
        for neighbor in edges[node]:
            if neighbor != parent_node:
                if not dfs2(neighbor, node):
                    return False
    if not dfs2(1, 0):
        return False

    # Check if the graph can be decomposed into N paths of length K
    path_count = 0
    for i in range(1, n + 1):
        if parent[i] == 0:
            path_count += 1
    if path_count != n:
        return False

    # Check if the graph can be decomposed into N paths of length K
    path_lengths = [0] * n
    for i in range(1, n + 1):
        path_lengths[parent[i]] += 1
    for i in range(1, n + 1):
        if path_lengths[i] != k:
            return False

    return True

def main():
    n, k, edges = read_input()
    if is_decomposable(n, k, edges):
        print("Yes")
    else:
        print("No")

if __name__ == "__main__":
