    graph = {i: {} for i in range(1, N + 1)}

    for u, v in edges:
        graph[u][v] = 0
        graph[v][u] = 0

    for _ in range(K):
        u, v = map(int, input().split())
        graph[u][v] = 1
        graph[v][u] = 1

    distances = dijkstra(graph, 1)
    return distances[N]

