import sys

def is_odd_cycle(graph):
    visited = [False] * (len(graph) + 1)
    stack = []
    for i in range(1, len(graph) + 1):
        if not visited[i]:
            if dfs(graph, i, visited, stack):
                return True
    return False

def dfs(graph, node, visited, stack):
    visited[node] = True
    stack.append(node)
    for neighbor in graph[node]:
        if not visited[neighbor]:
            if dfs(graph, neighbor, visited, stack):
                return True
        elif neighbor in stack:
            return True
    stack.pop()
    return False

def solve(n, m, edges):
    graph = [[] for _ in range(n + 1)]
    for u, v in edges:
        graph[u].append(v)
        graph[v].append(u)

    if is_odd_cycle(graph):
        return "Takahashi"
    else:
        return "Aoki"

def main():
    input = sys.stdin.read
    data = input().split()
    n = int(data[0])
    m = int(data[1])
    edges = []
    for _ in range(m):
        data = input().split()
        edges.append((int(data[0]), int(data[1])))

    print(solve(n, m, edges))

if __name__ == "__main__":
