from collections import defaultdict

def find(parent, x):
    if parent[x] != x:
        parent[x] = find(parent, parent[x])
    return parent[x]

def union(parent, x, y):
    root_x = find(parent, x)
    root_y = find(parent, y)
    if root_x != root_y:
        parent[root_x] = root_y

def min_edges_to_forest(n, edges):
    parent = list(range(n + 1))
    graph = defaultdict(list)
    for u, v in edges:
        graph[u].append(v)
        graph[v].append(u)

    edges_to_delete = 0
    for u in range(1, n + 1):
        if find(parent, u) != u:
            edges_to_delete += 1
            for v in graph[u]:
                if find(parent, v) != u:
                    union(parent, u, v)

    return edges_to_delete

