import sys
from collections import defaultdict

def build_graph(N, W, L, R):
    graph = defaultdict(list)
    for i in range(N):
        for j in range(i+1, N):
            if not (L[i] <= L[j] <= R[i] or L[j] <= L[i] <= R[j]):
                graph[i].append(j)
                graph[j].append(i)
    return graph

def find_min_weight_path(graph, s, t, W):
    visited = set()
    stack = [(s, 0)]
    while stack:
        node, weight = stack.pop()
        if node == t:
            return weight
        if node in visited:
            continue
        visited.add(node)
        for neighbor in graph[node]:
            stack.append((neighbor, weight + W[neighbor]))
    return -1

